import React, { useState } from "react";
import { FaBars } from "react-icons/fa";
import "./MobileMenu.css";

interface MobileMenu {
  menuActive: boolean;
}

export default function MobileMenu({ menuActive }: MobileMenu) {
  return (
    <div className={menuActive ? "MobileMenu active" : "MobileMenu"}></div>
  );
}
